import React from 'react';
import AppLayout from '../components/AppLayout';
const Home = () => {
	return (
		<AppLayout>
			<div> hello Next </div>
		</AppLayout>
	);
};
// AppLayout 안에 있는 것이 children이 되는 것.
export default Home;
